const img3="https://picsum.photos/300/300";
const links=""

ReactDom.render(
    <React.Fragment>
     <h1 contentEditable='true'>Hello, my name is {name}!</h1> 
     <img src={img1} alt="Lorem img"/>
     <img src={img2} alt="Lorem img"/>
     <a href={links}>

     <img src={img3} alt="Lorem img"/>
     </a>


    </React.Fragment>
